    "2016-07-27T22:48:55.104967",nt"name": "environmental-contaminants-in-golden-shiners-from-picnic-pond-u-s-naval-air-station-brunsw",nt"isopen":
    false,nt"url": null,nt"notes": "On July 25, 1995, the U.S. Fish and Wildlife
    Service conducted a contaminant survey of fish from Picnic Pond on the U.S. Naval
    Air Station in Brunswick, Maine (NASB). The 3.5-acre pond is located on the eastern
    portion of the installation where it receives flow from an unnamed stream. On several
    occasions in the past, spills from the NASB flight line introduced jet fuel into
    the unnamed stream. One of the installationu2019s Superfund hazardous waste sites,
    Site 9 (Neptune Drive Disposal Site), is also located beside the unnamed stream.
    Consequently, it is possible that aviation fuel or hazardous waste residues in the
    unnamed stream could also have been deposited into Picnic Pond. The purposes of
    the Picnic Pond survey were to qualitatively describe the fish resources in the
    pond, and to determine the concentrations of trace elements, organochlorine pesticides,
    and polychlorinated biphenyls (PCBs) in fish tissue.",nt"license_title": "License
